import React,{useState} from 'react'
function Count() {
  const[data,setData]=useState(0);

  const increment=()=>{
    setData(data+1);
  }
  const decrement=()=>{
    setData(data-1);
      
  }
  return (
    <div className='count app                                                                                                                                                                                                                                                                                                   '>
      <p>Count: {data}</p>
      <button onClick={decrement}>-</button> 
      <button onClick={increment}>+</button>   
    </div>
  )
}

export default Count;
